import React from 'react';
import Buttons from './Buttons';
import Text from './Text';

function ActionButton({ children, ...props }) {
    return (
        <Buttons
            minWidth="250px"
            height="50px"
            borderRadius="20"
            bg="#7C72FF"
            {...props}>
            {children}
        </Buttons>
    );
}


export default ActionButton;
